import { BrowserRouter as Router } from "react-router-dom";
import Header from "./components/Header";

import "./styles/style.scss";
class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      projects: <Projects />
    };
  }

  render() {
    return (
      <Router>
        <Header />
        <Routes />
      </Router>
    );
  }
}

export default App;
